import styled from "@emotion/styled";

const StyledBackLink = styled.div`
  &:hover {
    cursor: pointer;
  }
`;

const BackLink = ({ newScreen, setCurrentScreen }) => {
  return (
    <StyledBackLink onClick={() => setCurrentScreen(newScreen)}>
      ‚Üê Go back
    </StyledBackLink>
  );
};

export default BackLink;
